(1, 1, '754', 45, 'KASOTT Replacement Airpod Pro Ear Tip Premium Memory Foam Earbud Tips,', 'About this item [ Exclusive Customization ] Made specifically for Apple AirPods Pro 1st and 2nd generation, memory foam earbuds don\'t interfere with charging, provide a great sound experience, and adapt to the shape of your ear, making them suitable for different people. [ Premium Material ] The memory foam material has excellent texture and can slowly rebound when pressed, which fits the contour of your ear and better adapts to changes in the environment, providing you with a more comfortable experience. [ Good Noise Reduction ] This headphone plug can block external sound interference very well. You can immerse yourself in your own world without worrying about being disturbed by others, and enjoy watching movies and listening to music more happily. [ Small Appearance and Simple Installation ] This Apple AirPods Pro ear tip is relatively small and cute, and there is a storage box to place it. The snap-on design is simple and easy to understand. Just snap it into the headset for easy installation. [ Specifications and After Sales ] You will get 3 pairs of ear tips from us, you can choose the size you like, if you have any questions feel free to contact us, we are always there.', NULL, 'About this item [ Exclusive Customization ] Made specifically for Apple AirPods Pro 1st and 2nd generation, memory foam earbuds don\'t interfere with charging, provide a great sound experience, and ada...', 'kasott-replacement-airpod-pro-ear-tip-premium-memory-foam-earbud-tips', 'CPR-68862', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/51PJLJF3tIL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07'),
(2, 1, '754', 51, 'Trucker Bluetooth Headsets, Wireless Headset with AI Environmental Noi', 'About this item Industry Leading AI-Powered Environmental Noise CancellationEKSAtelecom cutting-edge AI-Powered ENC tech can dynamically detect and nullifies up to 99.8% ambient noise with a broad sound frequency range, and cancels it out before reaching your ears to get crystal-clear communication! 164 ft Ultra-Long Wireless ConnectionThis truck driver bluetooth headset with a noise-cancelling microphone features an ultra-long wireless operating range of up to 99 ft / 30 m away for better connectivity, faster transmission, and better stability. (Note: Wireless connection distance can reach even longer distances of 50 m / 164 ft, provided there are no obstacles.) Support 57 Hours Work Time & Mute FunctionWith a large 500mAh battery, It supports up to 30 hours of talk time and 57 hours of continuous music time, and it charges fully in just 1.5 hours. And you can monitor the battery level in your truck headset through your phone. And this wireless bluetooth headset with the mute function, you can click the mute button to toggle on and off the microphone during the call(only for phone calls). Wide Compatibility via Bluetooth 5.0 & USB DongleThe latest Bluetooth tech and powerful built-in Qualcomm Chip of Bluetooth phone headsets ensure a lightning-fast and ultra-stable connection. Just simply with a USB dongle (included!), no extra hassle to connect this EKSAtelecom trucker bluetooth headset to your desired Bluetooth devices & PC or laptop. EKSAtelecom CloudSoft Ear Cushions & 24-Month SupportSlip into over-the-ear comfort with soft, breathable, and gentle CloudSoft Ear Cushions. This ergonomic design of trucker headset keeps pressure off your head, preventing soreness or fatigue over time. You can relax in comfort and stay fully productive all day when you use our bluetooth headset with microphone. If you encounter any problems, please kindly contact our professional customer service team.', NULL, 'About this item Industry Leading AI-Powered Environmental Noise CancellationEKSAtelecom cutting-edge AI-Powered ENC tech can dynamically detect and nullifies up to 99.8% ambient noise with a broad...', 'trucker-bluetooth-headsets-wireless-headset-with-ai-environmental-noi', 'YML-97288', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/71AN83r4VmL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07'),
