(18, 1, '754', 208, 'Seagate Expansion 18TB External Hard Drive HDD - USB 3.0, with Rescue', 'Ideal for the home, office, or dorm, Seagate Expansion desktop drive offers enormous desktop storage for photos, movies, music, and more. Backing up and transferring content is incredibly easyjust drag and drop! To get set up, connect the USB hard drive to Windows or Macno software required. For Apple Time Machine, simply reformat. Included is an 18-inch USB 3.0 cable and 18W power adapter.', NULL, 'Ideal for the home, office, or dorm, Seagate Expansion desktop drive offers enormous desktop storage for photos, movies, music, and more. Backing up and transferring content is incredibly easyjust dr...', 'seagate-expansion-18tb-external-hard-drive-hdd-usb-30-with-rescue', 'YOE-51791', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/61NF1FZUYUL.__AC_SY445_SX342_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07'),
