(20, 1, '754', 174, 'GearIT Cat 6 Ethernet Cable 6 ft (24-Pack) - Cat6 Patch Cable, Cat 6 P', 'future-proof your network for 10-Gigabit Ethernet with GearIT Cat 6 network patch cables. With GearIT Cat6 cables, your network will be ready for the future and will still be working when you get there. industry standard ANSI/TIA-568-C.2, Cat 6, etc. Verified cables with High compliance RJ45 (8P8C) snag-less connectors and molded strain relief boots. Bandwidth rating of up to 550 MHz ensures compatibility with Ethernet 10BASE-T, 100base-tx(fast Ethernet), 1000base-t (Gigabit Ethernet), 10GBase-T (10-Gigabit Ethernet), peer-to-peer, and any other applications that utilize networking cables including telephony, home automation and long distance video transfer technologies like HMDI over Ethernet. Use to connect any network able device with RJ45 connection including PC\'s, laptops, servers, printers, NAS storage devices, VoIP, power over Ethernet (PoE), DVR\'s, etc. utp - Unshielded Twisted pairs -the effectiveness of UTP cable design which uses Twisted pairs without the need for additional shielding have allowed this Type of cabling to be the most cost effective solution available for any Type of advanced local area network connection and made it an industry standard for a wide variety of applications. specifications cable Type: Cat6, utp conductor material(more...)', NULL, 'future-proof your network for 10-Gigabit Ethernet with GearIT Cat 6 network patch cables. With GearIT Cat6 cables, your network will be ready for the future and will still be working when you get ther...', 'gearit-cat-6-ethernet-cable-6-ft-24-pack-cat6-patch-cable-cat-6-p', 'IW5-85477', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://images-na.ssl-images-amazon.com/images/I/51IEN-rt2RL._SY445_SX342_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07'),
(21, 1, '754', 239, 'Linksys Hydra 6 Mesh WiFi 6 Router - MR20EC-AMZ - Dual-Band WiFi Route', 'Introducing the Linksys Hydra 6 Mesh WiFi Router - Using the power of WiFi 6 to deliver lightning-fast internet speeds, seamless connectivity, and unmatched reliability, all in a sleek and stylish package. Linksys Hydra 6 is powered by WiFi 6 technology, so you\'ll experience fast internet speeds of up to 3.0 Gbps, making it perfect for streaming 4K videos, playing online games, and working from home without lag or buffering. Mesh WiFi 6 technology ensures you\'ll have a strong and stable signal throughout your home. With the Hydra 6, you can say goodbye to dead zones and weak connections. The device uses intelligent mesh technology to automatically optimize your network and provide you with the best possible performance.Setting up the Hydra 6 is quick and easy. Simply download the Linksys App and follow the step-by-step instructions. You\'ll be up and running in no time. The app allows you to manage your network, monitor internet usage, and control devices from anywhere. With its powerful WiFi coverage, you can blanket your entire home from the garage to the backyard guest house without needing a WiFi extender or WiFi booster', NULL, 'Introducing the Linksys Hydra 6 Mesh WiFi Router - Using the power of WiFi 6 to deliver lightning-fast internet speeds, seamless connectivity, and unmatched reliability, all in a sleek and stylish pac...', 'linksys-hydra-6-mesh-wifi-6-router-mr20ec-amz-dual-band-wifi-route', 'OQI-15813', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/61H6qtFLk9L.__AC_SX300_SY300_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07');
