(23, 1, '754', 208, 'Seagate Ultra Touch SSD 500GB External Solid State Drive Portable - Bl', 'Ultra Touch SSD is a palm-sized, portable solid state drive featuring an Android app so that users can bring extra protection to priceless photos, videos, and important files. Thanks to fast SSD speeds, this drive is perfect for streaming stored videos directly to a laptop and it even enables automatic, continuous backup via the included Sync Plus software. Universally compatible, it works Mac and Windows computerssimply connect via the integrated USB 3. 0 cable or the included USB-C adapter. To edit, manage, and share photos like a pro, take advantage of the complementary one-year Mylio Create subscription and the two-month membership to Adobes Creative Cloud Photography plan (not available in all countries). For long-term reliability, Ultra Touch includes a three-year limited product .', NULL, 'Ultra Touch SSD is a palm-sized, portable solid state drive featuring an Android app so that users can bring extra protection to priceless photos, videos, and important files. Thanks to fast SSD speed...', 'seagate-ultra-touch-ssd-500gb-external-solid-state-drive-portable-bl', 'HTJ-12937', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/91ICZcqIsyL.__AC_SX300_SY300_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07'),
