(26, 1, '754', 2, 'SAMSUNG Full Motion Slim TV Wall Mount, Fits 55- 65 TVs, Minimizes T', 'The Full Motion Slim Wall Mount minimizes the space between your TV and the wall so your TV looks good from every corner of the room.* You can adjust your TV left and right and even tilt it forward to bring the screen closer to you.** *Only available with compatible models. Please see the specification for a list of compatible models. It is necessary to secure at least 19.5mm distance between the wall and the TV. Actual distance between the wall and TV may vary depending on the wall type and installation method. **The range of tilting and swiveling of the Full Motion Slim Wall Mount vary by model. Please refer to the specifications for details. Compatible with the S95B TV model.', NULL, 'The Full Motion Slim Wall Mount minimizes the space between your TV and the wall so your TV looks good from every corner of the room.* You can adjust your TV left and right and even tilt it forward to...', 'samsung-full-motion-slim-tv-wall-mount-fits-55-65-tvs-minimizes-t', 'XRE-50448', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/51dpXc-6pKL.__AC_SY300_SX300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07'),
(27, 1, '754', 321, 'Bamboo Serving Tray,360Rotating Phone Stand, Coffee Table Tray for Ea', 'Our journey began with a simple idea: To harmonize daily life\'s practicality with nature\'s elegance. At BAMBOOTRAY, we invite you to embrace a lifestyle that honors nature\'s wisdom. Together, we can make sustainable choices and create a more harmonious world, one bamboo product at a time. Join us on this meaningful journey toward a brighter and greener future. Elevate your decor with the addition of a captivating ornament. With a diverse selection of colors and styles, BAMBOOTRAY trays effortlessly marry impeccable craftsmanship with a delightful visual appeal, offering an eye-catching and fashionable accent piece. This dinner tray is an excellent choice for wedding and housewarming gifts. You\'ll absolutely adore the remarkable features of BAMBOOTRAY trays: Overall dimension:15.3\"L9.8\"W0.8\"H Unique design: 360 rotatable phone bracket Natural bamboo:Sturdy, durable, organic Easy to clean: Simply wipe with a damp cloth Easy to store:Keep it in a drawer or against the wall     Humanized Hand Design The well-designed grooves of our breakfast tray makes it effortless to grip and transport, guaranteeing a seamless serving experience.   Smooth Surface The surface of this serving tray is meticulously crafted to achieve an incredibly smooth texture, providing a luxurious and refined appearance that adds an element of sophistication to any living space.   Easy to Clean To maintain the sparkle and cleanliness of these serving trays, a quick wipe-down with a damp cloth only takes a few seconds.   Easy to Store The lightweight design facilitates effortless maneuvering, enabling you to either lean it against the wall or store it in a drawer when not in use.               Decorative Tray Arranging cosmetics and perfumes on the tray serves both functionality and aesthetics. This stylish and efficient storage solution adds a touch of sophistication to your beauty routine, making it a delight to get ready every day. Trays for Afternoon Tea As you sip and savor the tea, you embrace the simplicity and authenticity that bamboo brings to the ritual, making your afternoon tea a genuine and grounding experience. Breakfast Tray Whether you prefer sipping coffee, indulging in pastries, or savoring a hearty breakfast, this tray provides a cozy and organized space to relish your favorite foods in the comfort of your home.', NULL, 'Our journey began with a simple idea: To harmonize daily life\'s practicality with nature\'s elegance. At BAMBOOTRAY, we invite you to embrace a lifestyle that honors nature\'s wisdom. Together, we can m...', 'bamboo-serving-tray360rotating-phone-stand-coffee-table-tray-for-ea', '3BL-91615', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/61+y7n-LquL._AC_SY300_SX300_.jpg\"]', '1', '2025-09-22 11:46:07', '2025-09-22 11:46:07'),
