(32, 1, '755', 41, 'Kishigo Premium Black Series Heavy Duty Unisex Reflective Safety Vest', 'The Kishigo Premium Black Series Heavy Duty Vest is ideal for those in the Transport Industry. The 2\" wide high performance reflective material is contrasted with 3\" of color for increased invisibility, with a clean and strong black trim. Made from 100% Ultra-Cool polyester mesh, this vest is designed for all day comfort and can easily be layered over clothes with a full front length zipper. This vest features two lower outside cargo pockets with adjustable flaps and grommets, a right chest 2-tier pencil pocket, left chest heavy duty gusseted radio/utility pocket with reflective piping and two inside patch pockets. For 50 years, Kishigo has made it our mission to design and manufacture high visibility clothing using the Our pledge to your safety is reflected in the uncompromising commitment to quality, innovation and comfort in every thread, in every seam, in everything we make and do. And we\'re proud to say the men and women we\'ve been outfitting in municipalities, cities, states and private industries have experience the Kishigo difference and loved it. This isn\'t just our profession- it\'s our passion. highest quality materials to craft apparel that is comfortable and built to last. We pride ourselves on our attention to detail and dedication to raising the bar not just for ourselves, but for the industry because nothing matters more than your safety! Whether working in transportation, roadwork, construction, or warehousing, we offer a wide variety of Reflective Safety Vests that are ANSI Type R / Class 2 Compliant, ensuring you always in sight and in compliance in your work zone.', NULL, 'The Kishigo Premium Black Series Heavy Duty Vest is ideal for those in the Transport Industry. The 2\" wide high performance reflective material is contrasted with 3\" of color for increased invisibilit...', 'kishigo-premium-black-series-heavy-duty-unisex-reflective-safety-vest', '