(33, 1, '755', 42, 'TWINSLUXES Solar Post Cap Lights Outdoor - Waterproof LED Fence Post S', 'Solar Post Cap Lights Waterproof LED Fence Post Solar Lights for \"3.5x3.5\" \"4x4\" \"5x5\" Wooden Posts. FEATURES & DETAILS   Product Specification Material: ABS Power Source: Solar-powered Lumens: 20 Lumens Color temperature: 3000k Light color: warm white LED: SMD 2835 0.5W *1 PCS Waterproof level: IP65 Battery: 600mah batteries Package Contents 1 x Solar post light 1 x Instruction Manual 1 x Installing Screw Set PERFECT FIT Fits wooden posts,vinyl posts or PVC posts The fence post lights solar powered is flexible and ingenious designed that this solar fence post lights can be easily installed on different inches of wooden or PVC vinyl columns. Ideal for patio, deck and garden decoration practical and beautiful Warm white LED makes the solar fence post lights well at night. How do solar deck post lights work? Its very simple. You mount post lights solar powered on posts that you stake into the ground, and during the day the solar panel atop of the lights collects rays from the sun, charging the battery within so that energy can be utilized as light when it gets dark. The solar fence post lights 4x4 have an internal light sensor so that this deck lights can turn on automatically at dusk, and off at dawn. How to use solar post lights Quick and easy Do It Yourself installation. Easy screw-down installation, all you have to do is mark a couple holes, and drill down to stabilize the fence post solar lights. Plastic housing and lens, both are waterproof and will withstand all weather conditions.     TWINSLUXES, developed since 1986, is a professional manufacturer of solar lights, with CCC, CQC, CE, SAA, UL, GS, ROHS, REACH, PAHS and other international authoritative quality certifications TWINSLUXES Solar Post Lights Outdoor In the Darkness If the surrounder of the solar post cap is full of artificial light on night, that it will not turn on. Because these post cap solar lights depend on the weak light to determine whether it is nighttime or not. So you\'d better moving fence solar lights to darker areas. Cleaning Dirty Solar Panels The solar panels will collect dirt and grime over time, then they can not receive sunlight efficiently as before. Remove any debris that has collected with a smooth wet cloth. If the 4x4 post solar lights doesn\'t light up,check whether the battery is fixed and whether the battery is normal Be sure the post cap lights is in a relatively sunny location. 30 days free return   The deck post lights are beautiful, exquisite and practical. Unique appearance post solar lights, with warm and comfortable light, suit your deck post. It also enriches the mood for night walking and provides convenience.       Unique Outdoor Decoration   The Designed Glass Ball   Turn It \"ON\"/ \"OFF\"       DIY Installation outdoor solar lights effective IP44 waterproof and heat-resistant . You can install on wood,post, in patio, deck,mailbox or garden . Even in the daytime, it is the best decoration. High Efficiency Reflector TWINSLUXES solar fence post light are of high transmittance. Has a unique appearance and distinctive crack effect Automatically turns on at dusk, off at dawn. Solar Powered The top polysilicon solar panel uses the natural power of the sun to charge the internal 1.2v Ni-MH AA rechargeable battery. No extra wiring required, and the brilliant LEDs are long lasting and energy efficient. Solar Pathway Lights Color Changing Solar Post Cap Lights Outdoor Flickering Flame for 3.5x3.5/4x4/5x5 Yard Deck Solar Garden Lights Outdoor Twinsluxes 2 Color modes Solar Post Lights for 3.5x3.5/4x4/5x5 and larger size Solar Garden Lights Outdoor Size Conventional 3.5x3.5/4x4/5x5 Conventional 3.5x3.5/4x4/5x5 and larger size Conventional Brightness 15lm 15lm 10lm 25lm 15lm Waterproof Grade IP44 IP44 IP44 IP44 IP44 Applicable scene Pathway/Sidewalk/ Lawn/Patio/Yard Post/Deck/Fence/Dock/Garden/ Patio/ Gate/ Pathway/Sidewalk/ Lawn/Patio/Yard Post/Deck/Fence/Dock/Garden/ Patio/ Gate/ Pathway/Sidewalk/ Lawn/Patio/Yard Color Cold Light/Color Changing Flame flicker Warm/Cold Light White light/Warm light Warm/Cold Light', NULL, 'Solar Post Cap Lights Waterproof LED Fence Post Solar Lights for \"3.5x3.5\" \"4x4\" \"5x5\" Wooden Posts. FEATURES & DETAILS   Product Specification Material: ABS Power Source: Solar-powered Lumens: 20 Lum...', 'twinsluxes-solar-post-cap-lights-outdoor-waterproof-led-fence-post-s', 'AEH-66066', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/71kCgl9yzzL.__AC_SY445_SX342_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:08', '2025-09-22 11:46:08'),
