(45, 1, '755', 64, 'FTL GU10 Led Bulb 5000K Daylight White Dimmable Spot Light 6W 600LM 50', 'About this item Energy Saving: FTL dimmable gu10 led bulb 5000k only uses 6 watts, it can replace 50w-60w halogen bulbs, saving over 90% electricity bill. Excellent Dimming: The 6w gu10 led bulbs dimmable daylight white color can be dimmed from 10-100%. The gu10 bulb is compatible with many dimmers. No buzzing, no humming. Easy Installation: Standard mr16 shape gu10 base two prong light bulb, easy to replace your existing led track light bulbs or recessed ceiling light bulbs, just screw in, plug and play. Long Lifespan: High quality driver and LED chips, 25,000 hours lifespan, saving your time to replace the led gu10 bulbs frequently. Wide Application: With 600lm super brightness, the led gu10 light bulb could be widely used as track lighting, recessed lighting, oven range hood light bulbs, kitchen light bulb, table lamps......  See more product details', NULL, 'About this item Energy Saving: FTL dimmable gu10 led bulb 5000k only uses 6 watts, it can replace 50w-60w halogen bulbs, saving over 90% electricity bill. Excellent Dimming: The 6w gu10 led bulbs di...', 'ftl-gu10-led-bulb-5000k-daylight-white-dimmable-spot-light-6w-600lm-50', '8AY-41339', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/71xkuebNKoL.__AC_SY445_SX342_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:08', '2025-09-22 11:46:08'),
