(61, 1, '756', 66, 'Koolertron One Handed Programmable Mechanical Keyboard with OEM Gatero', 'Read more Macro Keyboard Specifications: All 48 keys are programmable, 8 Macro Keys,No backlit Key number: 48 Keyboard switch: OEM Gateron Red Keystroke force: 4515cN Interface: 2 MINI USB Interfaces, USB2.1M detachable USB cable Rating: DC 5V, &lt;100mA 0Key speed: 1-100ms The Macro Keyboard Has 2 Working Modes Standard operating mode and configuration management mode . Configuration management mode: This mode is used to modify the keyboard key configuration and transfer the new configuration data to the keyboard for internal storage.Press and hold the first key in the upper left corner of the keyboard, plug and unplug the USB port to restart the keyboard, the panel lights enter the state of alternately flashing single and double lights, indicating that it enters the configuration management mode. In this mode, the keyboard keys cannot be used. .Standard operating mode: the normal operating mode after the keyboard usb is connected to the computer. Keyboard configuration software based on Windows Read more Mechanical Number Pad,Common Problem Question 1 : The keyboard cannot be connected to the computer, and the computer side shows that the device cannot be recognized? .There are many possibilities for the keyboard not working, please check if the USB cable is connected correctly; .The data cable is a fragile accessory, replace it with a new one. Question 2 : Do I need to install the driver? Plug and play, the user does not need to install the driver, the keyboard has been configured with four sets of data inside the keyboard when it leaves the factory, the user can use the \"keyboard configuration management program\" to query the specific factory configuration. Question 3: What should I do if the bottom of the keyboard is uneven? The four legs of the keyboard are unevenly shaken, you can hold both sides of the keyboard with both hands and twist slightly to adjust the balance; install the keyboard to increase the tripod. Shift/Lock Two Ways Key macro functions: shortcut keys, concurrency, loop, continuous; Keyboard built-in game macro function: cramp macro, delay macro Integrated analog mouse function Control the linear movement and movement of the mouse All keys have no hardware conflicts Up to 16 keys and clicks Read more Built-In Microprocessor (MCU) Main frequency 12MHz .All keys can be configured, and the configuration data is stored in the keyboard, which can be used under different computers; .Built-in Flash memory, save four groups of user keyboard configuration, corresponding to four application scenarios programmable keypad,Replace Button After pulling straight up with the tools in the package, brush the dust and replace other keycaps. Key cap replacement is convenient, at any time for different colors of the key cap. Macro Keyboard Package Included .1 x 48 Keys Professional Single-Handed Keyboard .4xKeyboard booster tripod .1 x USB Cable .Gift Accessories .1 x English User Manual Read more Read more', NULL, 'Read more Macro Keyboard Specifications: All 48 keys are programmable, 8 Macro Keys,No backlit Key number: 48 Keyboard switch: OEM Gateron Red Keystroke force: 4515cN Interface: 2 MINI USB Interfaces...', 'koolertron-one-handed-programmable-mechanical-keyboard-with-oem-gatero', 'YFJ-60496', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://images-na.ssl-images-amazon.com/images/I/71BV3U2VpWL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:08', '2025-09-22 11:46:08');
