ishing line can be used for freshwater with the great features of fast cutting water, extremely low memory,extra thin diameter ,smooth and high sensitivity. Saltwater Fishing RIKIMARU braided fishing line can be used for saltwater with the special coating,which can protect the line from corrosion.A powerful tool for you to catch fish with its stronger,smooth,zero stretch,higher abrasion resisitance. Ice Fishing RIKIMARU braided fishing line can be used for ice fishing with the great features of all-weather,high sensitivity and faster cutting water. It can help you catch more fish even in extreme weather.         Super knot strength Our PE line with fluorocarbon line will create a super strong knot for you. Smooth and Zero Stretch Our braided fishing line with extra thin diameter and the super PE material is more smooth.And this ensures that it is zero stretch. Stronger and Abrasion Resisitance The strong PE material and precise braid crafts make our fishing line stronger and higher abrasion resisitance. High quality fluorocarbon fishing line According to the size of PE line you purchased, we will give you a Fluorocarbon fishing line that can be used with it.       Bass Fishing Extremely low memory, faster cutting water,smooth and high sensitivity making our fishing line more suitable for bass fishing. Trout Fishing Our fishing line with zero stretch, smooth, faster cutting water, high sensitivity and higher abrasion resisitance will help you harvest more trout easily. Tuna Fishing Superior braided fishing line, superior abrasion resistance, stronger tensile testing, stronger load-bearing capacity, all of these qualities make it more suitable for catching large fish such as tuna.   RIKIMARU Fishing Line Make Life More Joy Powerful fishing line Superior PE material Diverse styles', NULL, 'Established in 1991,Rikimaru fishing tackle Co.,Ltd is a private enterprise integrating r&d,design,production and sales.We have more than 28 years of history of fishing tackle manufacturing.And we con...', 'rikimaru-braided-fishing-line-abrasion-resistant-superline-zero-stretc', 'TD5-51182', 1698, 1298, 1019, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/91v9F3UumES.__AC_SX300_SY300_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:46:10', '2025-09-22 11:46:10'),
