(141, 1, '759', 317, 'Heatshield Products 175105 Heatshield Armor 1/2\" Thick x 1\' Wide x 5\'', 'Exhaust heat wraps were just upgraded, up armor your exhaust heat insulation with Heatshield Armor. Heatshield Armor can reduce radiant heat from your exhaust pipe by 70. The outer armor of this exhaust heat shield allows it to be cleaned after installation, gives it a long lifespan, and also makes Heatshield Armor resistant to the elements. The inner ceramic liner makes it capable of withstanding 1800F continuous, which allows this heat shield to be placed directly on headers, turbo manifolds, down pipes, and exhaust pipes. It is flexible, easy to cut and install. It keeps heat in the exhaust system which creates a scavenging effect, allowing exhaust gases to flow out of the system faster. It also prevents radiant heat from entering the driver\'s compartment and stops radiant heat damage to other vehicle components. They recommend the 1/2 inch thick Heatshield Armor for forced induction and racing applications.', NULL, 'Exhaust heat wraps were just upgraded, up armor your exhaust heat insulation with Heatshield Armor. Heatshield Armor can reduce radiant heat from your exhaust pipe by 70. The outer armor of this exhau...', 'heatshield-products-175105-heatshield-armor-12-thick-x-1-wide-x-5', 'IU7-86939', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/818uT3gVMBL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:11', '2025-09-22 11:46:11'),
