(151, 1, '759', 437, 'Easton Encore Hybrid', 'The 2023 Easton Encore Hybrid -10 USSSA Baseball Bat pulls in all the best features of Easton\'s cutting edge bat engineering, resulting in a 2-piece hybrid bat that will earn you a reputation as an offensive force every time you step in the box. We built the barrel of this bat with CompCore Technology, pulling together cutting-edge elements of alloy and composite barrel design. To create the CompCore barrel, the ringless R5 alloy of the Encore Hybrid is thinned out by about 30% and then reinforced with Thermo Composite Technology across the length of the hitting surface. This creates an ultra-thin barrel wall, bigger sweet spot, and maximum \"trampoline effect\" upon contact. The PureLynk CXN joint connects the handle directly to the barrel, maximizing the energy transfer and stiff feel of the Pro-Stiff carbon handle. All of these features add up to a bat that captures as much energy as you can generate and efficiently transfers it to the baseball  but all you have to do is swing it hard and watch it fly. You\'ll not only see the difference that the Easton Encore Hybrid makes, but you\'ll hear it, too. The unique, cutting edge barrel design creates a one-of-a-kind sound off the bat that\'s sure to echo in a pitcher\'s ears as you\'re rounding the bases. We topped this bat off with Flow-Tack grip, our most premium bat grip, to give you the ultimate combination of cushion and tack swing after swing. The 2023 Easton Encore Hybrid -10 USSSA bat is the pinnacle of new innovation in both alloy and composite bat design. Get yours today and get an instant boost to your offense!', NULL, 'The 2023 Easton Encore Hybrid -10 USSSA Baseball Bat pulls in all the best features of Easton\'s cutting edge bat engineering, resulting in a 2-piece hybrid bat that will earn you a reputation as an of...', 'easton-encore-hybrid', 'ZBB-96929', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/41PcysjebKL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:11', '2025-09-22 11:46:11'),
(152, 1, '759', 453, 'DRAGONtail Shogun Furled Tenkara Line with Line Holder (Light-Weight Y', 'DRAGONtail Tenkara has taken the old Moonlit Shogun line and revamped it with a weight forward design for less line sag and with a powerful tip to turn over small flies. This makes it a sweet light weight wet fly/nymph line or a general light all-purpose line. If you treat this line with floatant it will float for dry flies. There is no lack of casting power in this line and it does well in lightly windy conditions. Comes with a PREMIUM Quality Tippet Ring that is MADE IN JAPAN so you dont have to worry about it cutting your tippet. Also comes on an awesome NIRVANA Tenkara Line Holder that you will love.', NULL, 'DRAGONtail Tenkara has taken the old Moonlit Shogun line and revamped it with a weight forward design for less line sag and with a powerful tip to turn over small flies. This makes it a sweet light we...', 'dragontail-shogun-furled-tenkara-line-with-line-holder-light-weight-y', 'MLF-32530', 1600, NULL, 960, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/71I9GAJm2+L._AC_SL1500_.jpg\", \"https://m.media-amazon.com/images/I/71asbN4Sh1L._AC_SL1500_.jpg\"]', '1', '2025-09-22 11:46:11', '2025-09-22 11:46:11'),
