(177, 1, '760', 512, 'Greenberry Organics Detox Charcoal Face Wash, Vitamin C, Green Tea, Te', 'About Greenberry Organics: Greenberry Organics stands as a brand with a purpose to ensure quality and natural beauty solutions and maintain macro focus on our consumers. We believe in transparency, small batch productions, safeguarding the environment, standardisation of products and using natural trusted ingredients. We follow the \"Make In India\" initiative where all of our ingredients are sourced from different parts of India by using the power of Ayurveda and Apothecary and our products are free from all toxins and chemicals.   WHAT DOES IT DO?       Minimizes Inflammation Clear and healthy skin is just a wash away, as our detox charcoal face wash is enriched with two potent natural ingredients that helps minimizes skin inflammation while soothing irritated and dry skin. Boost cell regeneration Boost that radiance and glow on your skin after every wash as it paves way for better cell regeneration to reveal a bright and radiant complexion. Exfoliates and Detoxifies Detox, exfoliate and extracts all impurities from the skin. It also unclogs pores from dirt and oil deposit, to make your skin feel refreshed while making it clearer and brighter. WHAT IT CONTAINS?       Essential Vitamin C Oil Boosts and brightens your skin with this potent antioxidant that neutralises free radicals, brightens skin and helps with natural skin regeneration process. Cleansing Tea Tree Oil Its soothing and anti-inflammatory properties helps in thoroughly cleansing the surface of your skin while treating inflamed parts of skin for a soothing and relaxed sensation. Detoxifying Green Tea Rich in antimicrobial, antioxidant and anti-inflammatory properties effective for treating acne.   Describe your products in three words. 100% natural, Paraben & sulfate free & Ayurvedic How did you come up with the idea for this product? During the 1970s a modern day over the counter products was rarely seen an