ea-te', 'CDP-75957', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/31BR9DYe5SL._SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:11', '2025-09-22 11:46:11'),
