(184, 1, '761', 114, 'Tayo Gani Lani Rogi Cito - The Little Bus Tayo Special Wind-Up Set', 'ICONIX has been steadily producing creative animation works including \' Tayo the Little Bus\', \'Chiro and Friends\', \'Tai Chi Chasers\', \'Z Rangers\' as well as \'Pororo the Little Penguin\' since its establishment in 2001. In addition, based on animation characters, ICONIX has been developing various Character businesses consisting of publication, toy, music, performance, theme park, character licensing etc... Pororo has had a brilliant success in last dacade. A lot of children were looking forward to watching new seasons. Also, Tayo the little bus became a huge success within a very short time. These animations are recommended for kids aged three and up. Here are some reasons children and parents like Tayo cartoon. Tayo directly promotes positive behavior. Meanwhile, Tayo is remanied respectful even when asserting his independence, and he\'s continuously open to learning. Even if he makes mistakes, like when he kept a resdcued puppy secret from his caretaker Hana, he is often motifvated by kindness. Secondly, Tayo prioritises safety. Tayo and his bus friends follow road rules and practice safety at all times. These cartoons constantly incorporates traffic rules into their storyline. This emphasises the importance of respecting authority and staying safe at all times. Also Tayo emphasises the importance of kindness and friendship. Tayo openly offers to babysit young buses to help them find their way. he also helps friends Rogi, Lani, and Gani become more mature buses while learning from them at the same time. Tayo is a helpful friend.', NULL, 'ICONIX has been steadily producing creative animation works including \' Tayo the Little Bus\', \'Chiro and Friends\', \'Tai Chi Chasers\', \'Z Rangers\' as well as \'Pororo the Little Penguin\' since its estab...', 'tayo-gani-lani-rogi-cito-the-little-bus-tayo-special-wind-up-set', 'RMU-58791', 0, NULL, 0, NULL, 0, NULL, NULL, NUL