(203, 1, '761', 864, 'Plants vs Zombies Garden Warfare(Online Play Required) - PlayStation 4', 'Shooters just got weird! Plants vs. Zombies Garden Warfare digs into the trenches with an explosive new action experience. Blast zombies, plants, and new characters across a mine-blowing world that delivers the depth of a traditional online shooter blended with the refreshing humor of Plants vs. Zombies. Take on Co-op and Multiplayer action with your friends and sow the seeds of victory! Online Play Required.', NULL, 'Shooters just got weird! Plants vs. Zombies Garden Warfare digs into the trenches with an explosive new action experience. Blast zombies, plants, and new characters across a mine-blowing world that de...', 'plants-vs-zombies-garden-warfareonline-play-required-playstation-4', '2LJ-52087', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://images-na.ssl-images-amazon.com/images/I/51SSWcJUhXL._SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:12', '2025-09-22 11:46:12'),
