(216, 1, '763', 739, 'PUR Gum Sugar Free Chewing Gum with Xylitol, Aspartame Free + Gluten F', 'WintergreenThis sugar free gum has a refreshingly icy mint flavor. Keep your mouth feeling fresh with an intense burst of classic wintergreen flavor. Each blister pack contains 9 pieces. PUR Gum is also available in Peppermint, Bubblegum, Spearmint, Cinnamon, Pomegranate Mint, Coolmint, and Chocolate Mint flavors.Our StoryFounded in 2010, PUR was built on the founding principle of making simple substitutions to promote a healthier lifestyle, without compromising taste or quality! With a growing number of dietary restrictions and health-conscious consumers, PUR set out to create products that everyone could safely consume, enjoy and share!Naturally Sweetened with 100% XylitolPUR uses xylitol sustainably sourced from Birch and Maple trees grown in Finland. It looks and tastes just like sugar with 40% less calories than sugar while boosting oral health.Swiss-MadeAll our ingredients are sourced from Europe and made in Switzerland. PUR is a quality first brand.', NULL, 'WintergreenThis sugar free gum has a refreshingly icy mint flavor. Keep your mouth feeling fresh with an intense burst of classic wintergreen flavor. Each blister pack contains 9 pieces. PUR Gum is al...', 'pur-gum-sugar-free-chewing-gum-with-xylitol-aspartame-free-gluten-f', 'MKK-49279', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://images-na.ssl-images-amazon.com/images/I/41NrfeSKM2S._SX300_SY300_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:46:12', '2025-09-22 11:46:12'),
(217, 1, '763', 919, 'Weruva Cats in the Kitchen, Chicken Frick \'A Zee with Chicken Au Jus C', 'Meet Weruva, Makers of Cats in the Kitchen: Weruva was founded over ten years ago by David & Stacie Forman and is still proud be family owned and operated. WeRuVa was inspired by and named after the founders three rescued cats; Webster, Rudi and Vanessa. With the search for The Best Cat Food Under the Sun never seeming to end, David & Stacie thought, Lets give it a shot ourselves  and gathered the best ingredients from around the world, formulated some fantastic recipes and created Weruva. Naturally, when they were lucky enough to have their rescued dog Baron enter the family, they decided to expand our products to include dog food. Our desire for more innovative, healthy pet products could not be stopped and we continued to dream up and produce some of the best products for pets and their people. Today, we have expanded our product offerings to include four cat wet food brands, two dog wet food brands, dry dog food, treats, pumpkin supplements and even litter! Quality Control, Safety & Ingredients: Weruva always strives to be more than just a pet food company. We are obsessive over Safety and Quality Control and only produce our products in BRC/USDA Approved Facilities; arguably the highest standards for human-food production. We also source responsible and sustainable raw materials. You will be happy to know Weruva uses Cage-Free Chickens, Grass-Fed Beef & Lamb, and Wild-Caught Fish. Did we mention everything is GMO-Free? Learn About Cats in the Kitchen Grain-Free Cat Cans & Pouches: The kitchen is so often the heart of the home. It is where our family gathers for meals, where we have our game night, where family bonds grow.We eat there, we laugh therewe feed our pets there. The inspiration for these delectable selections come from feeding our precious Cats in the Kitchen. Bring your cats to the heart of your home and share with us these savory cuts of white breast meat chicken and duck breast . . . delicate gravies, some with pumpkin for healthy digestion . . . loins from tuna, salmon and mackerel . . . and lean cuts of beef all fit for our kitchen carnivores. These recipes are among our most delicious offerings. We hope your kitties love Cats in the Kitchen as much as the WeRuVa cats doWebster, Rudi & Vanessa approved! How is Cats in the Kitchen Different? CITK is a cross between Weruva and BFF pouches contain boneless, skinless white breast meat chicken, fish loins and a few formulas in pumpkin soup. The cans contain similar ingredients, but weve added in novel proteins like lamb and turkey, and included some dark meat chicken. The cans feature fish oil. Unlike Weruva, some formulas combine the chicken and fish.Guaranteed Analysis:Crude Protein (min) 10%, Crude Fat (min) 1.6%, Crude Fiber (max) 0.5%, Moisture (max) 85%, Ash (max) 2.0%, Calcium (max) 0.25%, Phosphorus (max) 0.25%, Magnesium (max) 0.03%, Taurine (min) 0.05%AAFCO Statement:This cat food is formulated to meet nutritional levels established by the AAFCO cat food nutrient profiles for adult maintenance.', NULL, 'Meet Weruva, Makers of Cats in the Kitchen: Weruva was founded over ten years ago by David & Stacie Forman and is still proud be family owned and operated. WeRuVa was inspired by and named after the...', 'weruva-cats-in-the-kitchen-chicken-frick-a-zee-with-chicken-au-jus-c', 'LAE-74142', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://images-na.ssl-images-amazon.com/images/I/81wExJaFShL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:46:13', '2025-09-22 11:46:13'),
(218, 1, '763', 704, 'Sqwincher Powder Pack, Assorted Flavor Electrolyte Drink Concentrate,', 'Sqwincher powder concentrate electrolyte replacement beverage mix. The Sqwincher that is just right every time. Satisfy your Sqwincher craving in large or small amounts anytime you want. Great tasting, scientifically formulated electrolyte replacement drink is designed to restore important mineral salts and fluids lost through dehydration, physical exertion and heat stress. Sqwincher is more satisfying than water or soft drinks because the body absorbs it more quickly and restores it to its proper electrolyte and fluid balance. Powder Pack mixes quickly and easily with water. Sqwincher is the natural recovery source for dehydration. Make as little or as much Sqwincher as you want. Have a glass on a hot day, or help keep the whole basketball team cool. Four flavor pack of fruit punch, grape, lemon lime and orange. 2.5 Gallon yields.', NULL, 'Sqwincher powder concentrate electrolyte replacement beverage mix. The Sqwincher that is just right every time. Satisfy your Sqwincher craving in large or small amounts anytime you want. Great tasting...', 'sqwincher-powder-pack-assorted-flavor-electrolyte-drink-concentrate', '5FL-32471', 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://images-na.ssl-images-amazon.com/images/I/51bwSbIdBLL._SY445_SX342_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:46:13', '2025-09-22 11:46:13'),
(219, 1, '754', 45, 'KASOTT Replacement Airpod Pro Ear Tip Premium Memory Foam Earbud Tips,', 'About this item [ Exclusive Customization ] Made specifically for Apple AirPods Pro 1st and 2nd generation, memory foam earbuds don\'t interfere with charging, provide a great sound experience, and adapt to the shape of your ear, making them suitable for different people. [ Premium Material ] The memory foam material has excellent texture and can slowly rebound when pressed, which fits the contour of your ear and better adapts to changes in the environment, providing you with a more comfortable experience. [ Good Noise Reduction ] This headphone plug can block external sound interference very well. You can immerse yourself in your own world without worrying about being disturbed by others, and enjoy watching movies and listening to music more happily. [ Small Appearance and Simple Installation ] This Apple AirPods Pro ear tip is relatively small and cute, and there is a storage box to place it. The snap-on design is simple and easy to understand. Just snap it into the headset for easy installation. [ Specifications and After Sales ] You will get 3 pairs of ear tips from us, you can choose the size you like, if you have any questions feel free to contact us, we are always there.', NULL, 'About this item [ Exclusive Customization ] Made specifically for Apple AirPods Pro 1st and 2nd generation, memory foam earbuds don\'t interfere with charging, provide a great sound experience, and ada...', 'kasott-replacement-airpod-pro-ear-tip-premium-memory-foam-earbud-tips-1', '934-28198', 1788, NULL, 1073, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/51PJLJF3tIL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:15', '2025-09-22 11:50:15'),
