(233, 1, '754', 191, 'SPYPOINT LINK-MICRO-LTE Trail Camera-4 LED Infrared Flash with 80\'f De', 'LINK-MICRO-LTE A COMPACT POWERHOUSE The SPYPOINT LINK-MICRO-LTE is a remarkably compact cellular trail camera that delivers reliable connectivity and exceptional value. A photo-mode only camera, the LINK-MICRO-LTE offers a multi-shot function that takes up to two photos at each detection. You can configure the operating period, trigger speed, detection sensitivity, photo quality, photo delay, transfer time and transfer frequency to suit your needs. Four powerful LED lights and automatic infrared exposure provide up to 80 of night illumination. IMPORTANT: THE LINK-MICRO-LTE REQUIRES A POWER SOURCE (NOT INCLUDED) SUCH AS 8 AA NON-RECHARGEABLE LITHIUM BATTERIES OR A LIT-10 RECHARGEABLE LITHIUM BATTERY PACK. ACCESSORIES INCLUDED: Installation Strap REQUIRED AND NOT INCLUDED: A microSD card up to 32GB8 AA non-rechargeable lithium batteries or a LIT-10 rechargeable lithium battery pack PLEASE NOTE: THIS CAMERA IS CONFIGURED FOR USE IN THE UNITED STATES ONLY AND YOU MUST CHOOSE THE CARRIER WITH THE BEST SIGNAL IN YOUR AREA (VZN OR NATIONWIDE). SPYPOINT offers the only free photo transmission plan for cellular trail cameras: you receive 100 FREE photos per camera when you sign up for the SPYPOINT app. To receive more photos, upgrade your transmission plan. To save 20% on plans, join the SPYPOINT INSIDER\'S CLUB. To request HD photos or videos through the SPYPOINT app, the purchase of a Full-HD photo or video package is required. KEY SPECIFICATIONS TRIGGER SPEED: 0.4s FLASH RANGE: 80 FT DETECTION RANGE: 80 FT MEGAPIXELS: 10MP CAPTURE MODES: Photo CELLULAR NETWORK: LTE   SMALL SIZE: The LINK-MICRO-LTE is one of the smallest trail cameras on the market and features a heavy-duty camouflage design for optimal longevity and concealment in the field. CELLULAR: The LINK-MICRO-LTE\'s ultra-reliable connection to the LTE network allows you to remotely activate the camera, view and download your photos, check the status of your device or batteries, and adjust the settings of the camera using the SPYPOINT website or app. EXCEPTIONAL VALUE: The LINK-MICRO-LTE delivers innovative hunting technology at an affordable price any hunter can appreciate. NIGHT PHOTOS: Four powerful LED lights and automatic infrared exposure provide up to 80 of night illumination. SETTING UP YOUR LINK-MICRO-LTE CELLULAR TRAIL CAMERA         Choose a power source (SOLD SEPARATELY) We recommend using the SPYPOINT #LIT-10 rechargeable lithium battery pack, sold separately. For AA batteries, unlock the latch and open the LINK-MICRO-LTE door. Remove the battery compartment by grasping it by the 2 small notches on the side and pulling it out. Insert brand new AA batteries into the battery holder being careful to follow the polarity (+) and (-) indications. Place the battery holder back into the battery compartment. Remove the antenna mount and point the antenna in the desired direction. Format and install the microSD card (SOLD SEPARATELY) Before inserting the microSD card into your camera, it must be formatted by a computer to ensure proper operations. Once the card is formatted, make sure the camera is turned OFF. Find the microSD card slot located on the left, above the battery compartment. Insert the card into the slot with the metal contacts facing down. The card is inserted correctly when a click is heard. Activate the camera and release the antenna Activate the camera on the SPYPOINT website or app using the activation code located inside the LINK-MICRO-LTE\'s battery compartment, then configure the camera\'s settings. Remove the antenna mount to adjust the antenna during installation. Install and start the camera Choose a location for your camera and install it using the installation strap (included). Adjust the height of the camera to aim for the subject\'s mid-body. Avoid leaves, branches or tall grass in front of the camera as this can trigger motion detection resulting in blank photos. Follow the checklist on the inside of the camera\'s door to start the device. TROUBLESHOOTING The camera is not receiving a cellular signal. Verify the coverage area of the cellular network to make sure it reaches your area. Move your device to other locations to search for a stronger signal. Turn the device OFF and ON between the attempts. Make sure the antenna is installed properly (securely screwed down). Use the long range cellular antenna #CA-01 if necessary (sold separately). The camera is no longer responding. Make sure the batteries are sufficiently charged. NOTE: to verify the charge level, go to the STATUS section of your app and verify the battery % displayed. Dont forget that the indicated status is from the last transfer. Also, when turning on the camera, if the status light flashes red quickly, it indicates that the batterys charge is low. Turn the camera OFF and ON again. Remove and re-insert the battery compartment in the camera. From the app, reset the device to its original state. Perform the latest firmware update. The camera doesn\'t take pictures. Make sure the camera is turned ON. If it is not already done, remove the protective sticker on the detection lens of your camera. Format the microSD card. Do not choose the Quick format option. In your app, in your configurations, verify the operating periods you selected. Make sure the camera is not outside the operating periods. If none of the previous solutions works, reset the camera and the settings. The camera is not transmitting photos. Verify if the signal strength received by your device is sufficient. Make sure you have not reached the photo limit of your cellular plan. Verify if there is a message in the Photo section of your app: you will receive a notification if your camera is active, but no motion was detected. In those conditions, it is normal that your microSD card and your app did not receive new photos. Note that photos older than 7 days wont be transferred. How to distinguish between taking pictures and transmitting pictures from your camera to your app: they are two distinct camera functions. If your microSD card contains photos, the camera has no problem taking photos. If your microSD card is empty (doesnt contain photos), put it back in the camera and reboot your camera. Make a movement in front of the camera for it to take a photo. If there are still no photos on your microSD card, there is an issue with taking photos. If one or many photos are added to your microSD card once you have moved in front of your camera, after turning the camera off and on again, it should transfer them to your app in the next 15 minutes at most. Otherwise, there is an issue with photo transmission. The batteries are draining fast. The following configurations of your camera affect power consumption: delay between shots, multi-shots, detection sensibility, transfer frequency, and photo quality. If possible, choose less power-consuming options to optimize the life of your batteries. TROUBLESHOOTING The camera is not receiving a cellular signal. Verify the coverage area of the cellular network to make sure it reaches your area. Move your device to other locations to search for a stronger signal. Turn the device OFF and ON between the attempts. Make sure the antenna is installed properly (securely screwed down). Use the long range cellular antenna #CA-01 if necessary (sold separately). The camera is no longer responding. Make sure the batteries are sufficiently charged. NOTE: to verify the charge level, go to the STATUS section of your app and verify the battery % displayed. Dont forget that the indicated status is from the last transfer. Also, when turning on the camera, if the status light flashes red quickly, it indicates that the batterys charge is low. Turn the camera OFF and ON again. Remove and re-insert the battery compartment in the camera. From the app, reset the device to its original state. Perform the latest firmware update. The camera doesn\'t take pictures. Make sure the camera is turned ON. If it is not already done, remove the protective sticker on the detection lens of your camera. Format the microSD card. Do not choose the Quick format option. In your app, in your configurations, verify the operating periods you selected. Make sure the camera is not outside the operating periods. If none of the previous solutions works, reset the camera and the settings. The camera is not transmitting photos. Verify if the signal strength received by your device is sufficient. Make sure you have not reached the photo limit of your cellular plan. Verify if there is a message in the Photo section of your app: you will receive a notification if your camera is active, but no motion was detected. In those conditions, it is normal that your microSD card and your app did not receive new photos. Note that photos older than 7 days wont be transferred. How to distinguish between taking pictures and transmitting pictures from your camera to your app: they are two distinct camera functions. If your microSD card contains photos, the camera has no problem taking photos. If your microSD card is empty (doesnt contain photos), put it back in the camera and reboot your camera. Make a movement in front of the camera for it to take a photo. If there are still no photos on your microSD card, there is an issue with taking photos. If one or many photos are added to your microSD card once you have moved in front of your camera, after turning the camera off and on again, it should transfer them to your app in the next 15 minutes at most. Otherwise, there is an issue with photo transmission. The batteries are draining fast. The following configurations of your camera affect power consumption: delay between shots, multi-shots, detection sensibility, transfer frequency, and photo quality. If possible, choose less power-consuming options to optimize the life of your batteries. LINK-MICRO-LTE LINK-MICRO-LTE-S LINK-DARK LINK-S TRIGGER SPEED 0.4 SECONDS 0.4 SECONDS 0.07 SECONDS 0.07 SECONDS FLASH RANGE 80 FEET 80 FEET 80 FEET 100 FEET DETECTION RANGE 80 FEET 80 FEET 100 FEET 100 FEET MEGAPIXELS 10 10 12 12 MODES PHOTO AND MULTI-SHOT PHOTO AND MULTI-SHOT PHOTO, MULTI-SHOT, TIME-LAPSE, HD VIDEO PHOTO, MULTI-SHOT, TIME-LAPSE, HD VIDEO CELLULAR NETWORK LTE LTE LTE LTE FREE Photo Transmission Plan Option     Flexible Photo Transmission Plans to Fit Your Needs    ', NULL, 'LINK-MICRO-LTE A COMPACT POWERHOUSE The SPYPOINT LINK-MICRO-LTE is a remarkably compact cellular trail camera that delivers reliable connectivity and exceptional value. A photo-mode only camera, the L...', 'spypoint-link-micro-lte-trail-camera-4-led-infrared-flash-with-80f-de-1', 'MHI-46214', 13999, 6999, 8399, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/61KqlCFUSOL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:16', '2025-09-22 11:50:16'),
