(255, 1, '755', 52, 'LOOGU Desert Netting Scarf Tactical Miliary Camo Mesh Scarves for Men', 'LOOGU was founded in 2012 which focus on outdoor, hunting, army, camouflage, sporting goods,and other industries,Our main products are camouflage netting,ghillie suit,rain poncho,camo scarf,camo accessries,tarp,etc. We have specialized in textile fabrics for many years and continuously strive to improve our product design to provide competitive, cost-effective products and services. Thanks for your time and interest, please let us know if we can be of further assistance. Product Details       High Quality Production The camouflage mesh scarf is made of knit workmanship, which is more excellent than other sellers that made of drilling on whole cloth. Edge Workmanship Each camouflage mesh scarf is covered with a edging process so that the threads do not spread out. Two side of the edges are locked by a knitting process. Perfect for All Climate Main Use: Camouflage, resist cold and keep warm, defense sand, Anti-mosquito. The size is super large, it can be covered on the head after unfolding, can be used for tactical camouflage, does not obstruct the line of sight.   Product Real Show   Usage and Scene   NOTIES Please note that we ship from United Kingdom and China.For orders that you receive from China, customs or import fees may be due from a certain value. You can find more information on the \"Help pages\".', NULL, 'LOOGU was founded in 2012 which focus on outdoor, hunting, army, camouflage, sporting goods,and other industries,Our main products are camouflage netting,ghillie suit,rain poncho,camo scarf,camo acces...', 'loogu-desert-netting-scarf-tactical-miliary-camo-mesh-scarves-for-men-1', 'MDF-24981', 1399, 1119, 839, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/61IUzxKSEAL.__AC_SX300_SY300_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:50:16', '2025-09-22 11:50:16'),
(256, 1, '755', 54, 'Stahlwille 96410704 Double Ended Ring Wrench Set Corona, 6mm x 7mm to', 'Stahwhile96410704 Double-ended Ring Wrench Set CORONA with Shallow Offset Heads are made of chrome alloy steel, drop forged, hardened and tempered to provide high torque and added leverage, and polished with chrome finish for protection against rust and corrosion and offers high hardness. This professional wrench set has thin-walled rings and 10-degree shallow ring end offset which facilitate work in confined or tight spaces, perfect hand tool for automotive repair and maintenance, machinery, etc. In addition, the rings are higher than standard nuts - which prevents the spanner seizing on the nut. It also has Anti-Slip Drive (AS Drive) profile which enables high force transmission without damaging the fasteners. While the force acts on the flats of the screws, the corners are left free and are not rounded off. This wrench set is packed in a carton. It includes 6mm x 7mm, 8mm x 9mm, 10mm x 11mm, 12mm x 13mm, 14mm x 15mm, 16mm x 17mm, 18mm x 19mm, and 20mm x 22mm double ended ring wrenches. Made of course in Germany and manufactured under the most stringent quality control conditions and adheres to DIN897/ISO10104 specifications. There are many wrenches available. But hardly any that are as well thought out as Stahlwille wrenches. The non-slip finish means all our wrenches fit comfortably in the hand, even when used for long periods of time and when higher forces are applied. By combining high-quality special steels, which are subject to continuous quality controls, with a sophisticated forging process, we make them particularly durable and robust. The thumb groove along the wrench handle eliminates material where there is no stress and concentrates it where it is needed. Similar to the principle of an H-beam in construction, extreme load bearing capacity and maximum flexural strength are achieved with lower weight. As one of only a few manufacturers, Stahlwille offers a comprehensively diverse range of metric, imperial, spline drive and TORX wrenches. Stahlwille\'s tight manufacturing tolerances and reproducible dimensional accuracy ensure that one Stahlwille wrench is as close-fitting as the next. In this way, both open-jaw and ring wrenches will always firmly hug the fastener head for excellent power-lock.', NULL, 'Stahwhile96410704 Double-ended Ring Wrench Set CORONA with Shallow Offset Heads are made of chrome alloy steel, drop forged, hardened and tempered to provide high torque and added leverage, and polis...', 'stahlwille-96410704-double-ended-ring-wrench-set-corona-6mm-x-7mm-to-1', '6JE-11563', 14995, 14110, 8997, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/41SABKadJNL._SY445_SX342_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:16', '2025-09-22 11:50:16'),
