(259, 1, '755', 59, 'Braun SE5-895 Epilator, Hair Removal Device, Epilator for Women, Inclu', 'Introducing the beauty set 5, The Starter 5-in-1 hair removal & Beauty set for face and body. Epilate, shave, trim, cleanse, exfoliate and apply creams and makeup. 1x Body exfoliation brush Attachment removes dead skin cells, to prevent ingrown hairs. Epilator removes 4x shorter hair than wax for up to 4 weeks of smooth skin. Includes a shaver & trimmer attachment for hair removal in sensitive areas. 3x Facial brush attachments to cleanse and exfoliate. Cordless use up to 30 mins. 100% wet and dry. Use in the bath or shower to reduce discomfort. Epilation is virtually painless with regular use. Braun Epilators (SE5, SE7, SE9, SE9 Flex) are GreenCircle certified as a sustainable solution with certified energy savings. The other accessories and attachments in the box were not assessed by GreenCircle.', NULL, 'Introducing the beauty set 5, The Starter 5-in-1 hair removal & Beauty set for face and body. Epilate, shave, trim, cleanse, exfoliate and apply creams and makeup. 1x Body exfoliation brush Attachment...', 'braun-se5-895-epilator-hair-removal-device-epilator-for-women-inclu-1', '8NI-66283', 9999, 9494, 5999, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/41DMoSGOcoL._SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:16', '2025-09-22 11:50:16'),
(260, 1, '755', 61, 'Swanson Raw Multi-Glandular for Men 60 Capsules', 'Raw Multi-Glandular for Men High quality glandular supplement For a high quality glandular supplement, developed by Swanson Health Products as part of our line of glandular products, try Swanson Premium Raw Multi-Glandular for Men. Back in the 1930s, four key factors led to glandulars becoming popular in the supplement world: the material was abundant to produce these products, the historical rationale for use and the evidence of safety were strong, and their affordability made them particularly attractive. These truths remain today, and because of a strong demand from you Swanson Health Products has developed a full line of glandular products, including our Raw Multi-Glandular for Men supplement (raw orchic, raw prostate, raw heart, raw kidney and raw liver tissues). All of our glandular products are frozen when raw to preserve active components then desiccated (dried), powdered, and defatted in the heartland of America. *These statements have not been evaluated by the Food and Drug Administration. This product is not intended to diagnose, treat, cure or prevent any disease. Read more SIMPLIFYING WELLNESS Health &amp; Vitality Our goal is to provide you with science-backed, simplified health and wellness solutions to nurture your wellness journey every day. We believe in health and vitality at every age, which is why our nutrition scientists and innovation experts continually search the globe for better ingredients and new scientific research findings to create vitamins, supplements and wellness products that fit easily into your modern life. CELEBRATING HEALTH Innovation &amp; Research At Swanson, we get it! Nutrition and exercise needs can change due to lifestyle, environment, work, illness, age and more. Our products are inspired by clinical research backed by scientific consensus. Each is formulated to deliver the highest quality with the lowest environmental impact. Our nutritional supplements and wellness products are trusted by healthcare practitioners and consumers worldwide. FOUNDED IN AMERICA Strong Heritage Our story began in Fargo, North Dakota, when a man with a passion for golf was looking to lessen his joint pain. His research into the benefits of vitamins and supplements nurtured a deep commitment to wellness at every age and a desire to share his findings with others. In 1969, our first product was vitamin E to support cardiovascular health and antioxidant activity to neutralize free radicals.* Today, we offer thousands of innovative, science-backed wellness solutions and nutritional supplements that help people live SIMPLY HEALTHIER TOGETHER . Read more GMP-VERIFIED MANUFACTURER Good Manufacturing Practices We take quality seriously, and that\'s why we are voluntary members of NSF International and follow Good Manufacturing Practices to ensure that our procedures are the best they can be. Quality Testing Our quality testing includes, but is not limited to: Purity (HPLC): testing raw ingredients before manufacturing to make sure that they are pure; we compare to a standard with a known concentration Potency (HPLC): testing finished products to ensure they meet label claims Identity (HPLC, FTIR or HPTLC): testing all raw ingredients; the HPTLC is for botanicals only while all other ingredients are tested through HPLC or FTIR Microbiology (Biolumix): testing all raw ingredients and finished products for aerobic bacterial count, yeast and mold, Salmonella, E. coli and more Heavy Metals &amp; Metal Assays (ICP-MS): testing includes lead, mercury, cadmium, arsenic and more done on all raw ingredients and finished products, plus minerals such as magnesium, calcium and more. Read more PURITY &amp; POTENCY By following strict guidelines, we ensure our products are carefully and rigorously tested for both purity and potency. Third-Party Testing These labs are ISO 17025 Certified. ISO/IEC 17025 is the standard accreditation most labs must hold in order to be deemed technically competent. Laboratories use ISO/IEC 17025 to implement a quality system aimed at improving their ability to consistently produce valid results. Industry Regulations (FDA &amp; FTC) Swanson complies with both Food and Drug Administration (FDA) and the Federal Trade Commission (FTC) guidelines. These ensure that consumers can trust the label information and safety of all our products. Virtually all facets of supplement manufacturing, labeling and marketing are covered by extensive regulations issued and enforced by the FDA and FTC. * These statements have not been evaluated by the Food and Drug Administration. These products are not intended to diagnose, treat, cure or prevent any disease. Read more Read more', NULL, 'Raw Multi-Glandular for Men High quality glandular supplement For a high quality glandular supplement, developed by Swanson Health Products as part of our line of glandular products, try Swanson Premi...', 'swanson-raw-multi-glandular-for-men-60-capsules-1', 'HAZ-22641', 1399, 1280, 839, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://images-na.ssl-images-amazon.com/images/I/61bWRQY-3mL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:16', '2025-09-22 11:50:16'),
(261, 1, '755', 62, 'Dingo Mens Dean Harness Pull On Casual Boots Mid Calf - Black', 'A harness and pull-on straps blend with western lines in this classic boot. Dingo makes great boots whether you are looking for fashion or function! Dingo\'s boot line is full of styles that will please the western and motorcycle crowds. Dingo boots have a reputation for producing tough yet stylish western boots. Dingo boots, the boot people buy by name. Nobody Puts Leather Together Like Dingo!', NULL, 'A harness and pull-on straps blend with western lines in this classic boot. Dingo makes great boots whether you are looking for fashion or function! Dingo\'s boot line is full of styles that will pleas...', 'dingo-mens-dean-harness-pull-on-casual-boots-mid-calf-black-1', 'PQM-47227', 15995, 14495, 9597, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/91Osukc6XBL.__AC_SX395_SY395_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:16', '2025-09-22 11:50:16'),
