(270, 1, '755', 25, 'DJDAJIA 24\" x10Pack Bungee Cords with Hooks, 9mm Heavy Duty Bungee Cor', 'Introducing our Heavy Duty Blue Bungee Cords - the ultimate solution for all your outdoor needs! Measuring 24 inches in length and crafted with a sturdy 9mm thickness, these weatherproof and UV-resistant bungee cords are designed to withstand the toughest conditions.With their sleek blue color, these bungee cords not only provide a secure and reliable hold but also add a touch of style to any outdoor setup. The heavy-duty hooks ensure a firm grip, making them perfect for securing camping gear, tarps, luggage, and more.Whether you\'re an avid adventurer, a DIY enthusiast, or simply need a reliable tool for everyday use, our blue bungee cords are your go-to choice. Versatile and durable, these bungee cords are designed to handle any task effortlessly.So, why settle for ordinary cords when you can have the best? Upgrade to our Heavy Duty Blue Bungee Cords and experience the reliability and strength you deserve. Don\'t let anything hold you back - choose the best bungee cords on the market today! WARNING: Stretch cord carefully. Rebounding hooks cause injuries. Place hooks with care. Keep face and body out of rebound path. DO NOT overstretch. DO NOT use when strap has visible signs of wear or damage.', NULL, 'Introducing our Heavy Duty Blue Bungee Cords - the ultimate solution for all your outdoor needs! Measuring 24 inches in length and crafted with a sturdy 9mm thickness, these weatherproof and UV-resist...', 'djdajia-24-x10pack-bungee-cords-with-hooks-9mm-heavy-duty-bungee-cor-1', '4JW-92498', 1895, 947, 1137, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/71TGIkJbxmL.__AC_SX300_SY300_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:50:17', '2025-09-22 11:50:17'),
(271, 1, '755', 81, 'Roof and Gutter Deicing Cable - 80\' Black Electric Heating Cord with 3', 'This pre-assembled cable has been designed for the sole purpose of preventing the formation of ice dams on pitched roofs with non-combustible tab shingles and in metal or plastic gutters and downspouts. It provides drainage channels so that as natural thawing occurs, water has a path to flow off the roof and through the gutters and downspouts. This cable is not for use on a flat roof nor is it intended to clear the roof of snow and ice. The installation of this product is simple and it can be used with either metal or plastic gutters. Read and follow all instructions and pay particular attention to the following points: Install the cable when the outside temperature is above 50F because at lower temperatures shingle material may be brittle; Clear all leaves, pine needles and debris from the roof, gutters and downspouts before operating the cable. Do not plug the cable in unless it has been completely uncoiled or it will be damaged. Each package contains one ready-to-install cable, shingle clips, cable spacers and complete installation instructions. You will also need a tape measure, marker, gloves, ladder and a weatherproof GFCI outlet with control switch.', NULL, 'This pre-assembled cable has been designed for the sole purpose of preventing the formation of ice dams on pitched roofs with non-combustible tab shingles and in metal or plastic gutters and downspout...', 'roof-and-gutter-deicing-cable-80-black-electric-heating-cord-with-3-1', 'JK0-42624', 7208, 6848, 4325, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/71YUr1yeNJL.__AC_SY300_SX300_QL70_ML2_.jpg\"]', '1', '2025-09-22 11:50:17', '2025-09-22 11:50:17'),
