(322, 1, '758', 107, 'Bluemoon Homes Sheet Sets for King Size Bed Egyptian Cotton 800 Thread', 'Q. What is 100% Egyptian cotton? Ans. The strong and unbroken yarn of Egyptian cotton results in a fabric that is flexible. This means that 100% Egyptian cotton bed sheets feel super soft and can last even longer than regular cotton. It also doesn\'t pill, unlike another cotton, even after many washes. Q. What are the fabrics used in this product? Ans. The thread and yarn we use to make of 100% long-staple Egyptian cotton fabric and gorgeous sateen weave. Egyptian cotton produces fibers that are far longer than other cotton. These fibers are smaller in diameter, longer in length, and much stronger than other types of cotton have.   We Work for Customer Needs Q. What is the difference between cotton and Egyptian cotton? Ans. Egyptian cotton is stronger than regular cotton, therefore longer-lasting. It\'s partly thanks to the extra-long fibers that Egyptian cotton plants produce, making yarns tougher yet oh so soft. Q. Are Egyptian cotton sheets worth it? Ans. Egyptian cotton sheets are often considered the height of luxury. They\'re prized for their superior softness, durability, and breathability. The distinct feel of Egyptian cotton sheets comes from the unique properties of Egyptian cotton itself.   Q. What\'s a good thread count on sheets? Ans. Thread count refers to the number of horizontal and vertical threads per square inch. Generally, the higher the thread count, the softer the sheet, and the more likely it will wear well  or even soften  over time. Good sheets range anywhere from 200 to 1000, although you\'ll occasionally see numbers over 1,000. Q. How often should you wash Egyptian cotton sheets? Ans. Normally, you should wash your Egyptian cotton sheets every 7-14 days to remove the sweat and oils that might otherwise cause your sheets to turn yellow.       Q. What is the dimension of this item? Ans. Choose the sheet set that fits your needs. Twin: 1 Fitted She