(356, 1, '759', 305, 'Kelty Low-Love Seat Camping Chair - Portable, Folding Chair for Festiv', 'About this item 600d Heavy Duty Polyester Imported Camping friendly cuddle couch: low base 13.5 inches off the ground; relaxed, slightly reclining design with room for two (plus the family dog). 42 inches of seating space on Cushioned, insulated, nearly indestructible 600D weight polyester fabric. The beach chair standard: you dont have to be at the beach to enjoy, but if you are, the low loveseat is the perfect way to chill in the surf without getting wet. Sturdy and durable steel frame makes this chair an outdoor chilling staple. Insulated beverage holders: Each adjustable armrest includes an insulated beverage holder, with enough space left over for munchies, Marshmallows, or the drink on deck. Made to last: quality materials and thoughtful Kelty craftsmanship will keep your buns and back warm on cool nights for years to come. Steel framed construction, puppy-proof fabric, and a weight capacity of 500 lbs. Padded roll tote storage: no need to labor over lugging this thing around, the low loveseat folds neatly into the included roll tote and can be tossed over the shoulder for simple Transport at 15 lbs Total weight.', NULL, 'About this item 600d Heavy Duty Polyester Imported Camping friendly cuddle couch: low base 13.5 inches off the ground; relaxed, slightly reclining design with room for two (plus the family dog). 42 in...', 'kelty-low-love-seat-camping-chair-portable-folding-chair-for-festiv-1', 'YJV-56798', 130, NULL, 78, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/51mXfKVhLuL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:19', '2025-09-22 11:50:19'),
