(368, 1, '759', 392, 'Molten VBU12 Light Volleyball', 'As the Official Volleyball of USA Volleyball and USYVL Approved, Moltens VBU12 Youth Volleyball is ideal for young athletes ready to get serious about the game. The soft, micro-fiber composite cover and the uni-bladder cotton wrapped construction combined with its light weight provide a soft touch, allowing young athletes to maximize improvement. Moltens VBU12 Volleyball Series is intended for players age 12 and under and is available in a variety of colors.', NULL, 'As the Official Volleyball of USA Volleyball and USYVL Approved, Moltens VBU12 Youth Volleyball is ideal for young athletes ready to get serious about the game. The soft, micro-fiber composite cover...', 'molten-vbu12-light-volleyball-1', 'AJ9-73300', 515, 349, 309, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/61K+kUZ6GDL._AC_SY300_SX300_.jpg\"]', '1', '2025-09-22 11:50:19', '2025-09-22 11:50:19'),
(369, 1, '759', 437, 'Easton Encore Hybrid', 'The 2023 Easton Encore Hybrid -10 USSSA Baseball Bat pulls in all the best features of Easton\'s cutting edge bat engineering, resulting in a 2-piece hybrid bat that will earn you a reputation as an offensive force every time you step in the box. We built the barrel of this bat with CompCore Technology, pulling together cutting-edge elements of alloy and composite barrel design. To create the CompCore barrel, the ringless R5 alloy of the Encore Hybrid is thinned out by about 30% and then reinforced with Thermo Composite Technology across the length of the hitting surface. This creates an ultra-thin barrel wall, bigger sweet spot, and maximum \"trampoline effect\" upon contact. The PureLynk CXN joint connects the handle directly to the barrel, maximizing the energy transfer and stiff feel of the Pro-Stiff carbon handle. All of these features add up to a bat that captures as much energy as you can generate and efficiently transfers it to the baseball  but all you have to do is swing it hard and watch it fly. You\'ll not only see the difference that the Easton Encore Hybrid makes, but you\'ll hear it, too. The unique, cutting edge barrel design creates a one-of-a-kind sound off the bat that\'s sure to echo in a pitcher\'s ears as you\'re rounding the bases. We topped this bat off with Flow-Tack grip, our most premium bat grip, to give you the ultimate combination of cushion and tack swing after swing. The 2023 Easton Encore Hybrid -10 USSSA bat is the pinnacle of new innovation in both alloy and composite bat design. Get yours today and get an instant boost to your offense!', NULL, 'The 2023 Easton Encore Hybrid -10 USSSA Baseball Bat pulls in all the best features of Easton\'s cutting edge bat engineering, resulting in a 2-piece hybrid bat that will earn you a reputation as an of...', 'easton-encore-hybrid-1', 'VOY-27581', 39995, 16495, 23997, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/41PcysjebKL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:20', '2025-09-22 11:50:20'),
