(374, 1, '760', 92, 'STAMIO Orange Peel Powder 100 gm for Face Pack, Skin Care, Mask, DIY |', 'Face Pack/Mask you can Easily Prepare with Orange Peel Powder Orange Peel Powder rich in vitamin C that protects skin from free radical damage, keeps skin hydrated and moisturized. It helps to care for the skin naturally and remove all the impurities. Brighten your skin tone with the anti-oxidant property of orange peel and maintains the elasticity of skin. It works in the best possible ways to keep you glowing and healthy. It gives off a rejuvenating face and skin when added to water or other essential oil and ingredients.   - Orange Peel And Yoghurt Face Pack - Method of Preparation: Take one tablespoon of orange peel powder and two tablespoons of yoghurt (also known as Dahi) and combine them. Thoroughly mix them until a paste is formed. Apply this pack on your face for about 15 to 20 minutes and rinse it off. Apply this pack once or twice a week. - Orange Peel, Multani Mitti And Rose Water Face Pack - Method of Preparation: Take one tablespoon of orange peel powder and equal quantities of stamio Multani mitti and rose water. Mix them well. Apply the paste on your face and neck. Then leave it on for about 40 minutes. Rinse it offend pat your face dry. - Orange Peel, Turmeric And Honey Face Pack - Method of Preparation: Take one tablespoon of honey, orange peel powder and turmeric powder. Mix well until a paste-like consistency has formed. Apply this pack to your face and neck and keep it for 5-10 minutes. Rub and rinse it off using wet fingers working in a circular motion. - Orange Peel Powder, Sandalwood And Walnut Powder Face Pack - Method of Preparation: Add one tablespoon of orange peel powder, stamio sandalwood powder, walnut powder to a container. Add 2 to 3 drops of lemon juice and two tablespoons of rose water to this mixture. An alternative to orange peel powder for this pack can be orange pulp. Leave this pack for about 5 to 10 minutes and rinse it off. - Orange Peel And Lime Face Pack - Method of Preparation: Add 2 to 3 drops of lime to 2 tablespoons of orange peel powder. You can also add sandalwood powder to this combination. Apply this to your face and leave it on for 30 minutes and rinse it off. - Papaya And Orange Peel Powder Face Pack - Method of Preparation: Mash one orange and extract its pulp or add some orange peel powder to mashed papaya in a bowl. Apply it to your face and neck area using a brush or lather it on using your fingers, massage it in and keep it for 15-20 minutes. Rinse it off with water and pat dry. - Orange And Neem Face Pack - Method of Preparation: Take two tablespoons of orange peel powder, 2 tablespoons of stamio neem leaves powder and 1 tablespoon of soy milk. Mix these ingredients together and keep it on for 15 minutes. Rinse it with cold water. - Orange And Green Tea Pack - Method of Preparation: Take half a teaspoon of green tea leaves and one tablespoon of orange powder, mix these ingredients in a bowl. Next, keep it on for about 15-20 minutes and rinse it off once dry. Use this pack once in two days. - Coconut Oil And Orange Peel Powder Face Pack - Method of Preparation: Take one teaspoon of coconut oil and one tablespoon of or orangepeel powder. Add coconut oil to orange peel powder in a bowl. Mix it well and apply it to your face for 30 minutes. Clean this off using cotton swabs or cotton balls dipped in water. Multani Mitti Powder Rose Petal Powder Neem Leaf Powder Sandalwood Powder Fenugreek Powder Pure & Natural      Chemical Free      Packaging Pet Jar Pet Jar Pet Jar Pet Jar Pet Jar Packed Qty 100gm 50gm 100gm 80gm 100gm', NULL, 'Face Pack/Mask you can Easily Prepare with Orange Peel Powder Orange Peel Powder rich in vitamin C that protects skin from free radical damage, keeps skin hydrated and moisturized. It helps to care fo...', 'stamio-orange-peel-powder-100-gm-for-face-pack-skin-care-mask-diy-1', 'QNV-57093', 26700, 18900, 16020, NULL, 0, NULL, NULL, NULL, NULL, '[\"https:/