(380, 1, '760', 228, 'ECLIPSE Hair Fibers Light Brown for Thinning Hair for Women & Men to C', 'Are you concerned about thinning hair? Do you feel like you have to style your hair a certain way to cover up those areas? Well, worry no more! With Eclipse Hair Fibers, you can get the appearance of thicker, fuller hair in just 15 seconds. All you have to do is shake the hair fibers into your thinning areas and voila! You\'ll see instant results that are undetectable from just inches away. So no one will know you\'re using hair fibers to conceal your thinning areas. Eclipse Hair Fibers are made of natural keratin fibers that bond securely to your existing hair. They\'re also completely safe and gentle on your scalp and won\'t cause any irritation. And because they\'re made of natural fibers, they\'ll resist wind, rain, and perspiration for long-lasting results. So if you\'re looking for a way to get the appearance of thicker, fuller hair quickly and easily, then Eclipse Hair Fibers are the perfect solution for you! And because our Hair Fibers have been used by Hollywood Stylists and Barbers for the top celebrities, you can trust that they will give you the look you want. So don\'t wait any longer, try Eclipse Hair Fibers today!', NULL, 'Are you concerned about thinning hair? Do you feel like you have to style your hair a certain way to cover up those areas? Well, worry no more! With Eclipse Hair Fibers, you can get the appearance of...', 'eclipse-hair-fibers-light-brown-for-thinning-hair-for-women-men-to-c-1', 'PYN-70665', 3499, NULL, 2099, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/W/WEBP_402378-T1/images/I/41YWKep88+L._SY300_SX300_.jpg\"]', '1', '2025-09-22 11:50:20', '2025-09-22 11:50:20'),
