(395, 1, '760', 512, 'Greenberry Organics Detox Charcoal Face Wash, Vitamin C, Green Tea, Te', 'About Greenberry Organics: Greenberry Organics stands as a brand with a purpose to ensure quality and natural beauty solutions and maintain macro focus on our consumers. We believe in transparency, small batch productions, safeguarding the environment, standardisation of products and using natural trusted ingredients. We follow the \"Make In India\" initiative where all of our ingredients are sourced from different parts of India by using the power of Ayurveda and Apothecary and our products are free from all toxins and chemicals.   WHAT DOES IT DO?       Minimizes Inflammation Clear and healthy skin is just a wash away, as our detox charcoal face wash is enriched with two potent natural ingredients that helps minimizes skin inflammation while soothing irritated and dry skin. Boost cell regeneration Boost that radiance and glow on your skin after every wash as it paves way for better cell regeneration to reveal a bright and radiant complexion. Exfoliates and Detoxifies Detox, exfoliate and extracts all impurities from the skin. It also unclogs pores from dirt and oil deposit, to make your skin feel refreshed while making it clearer and brighter. WHAT IT CONTAINS?       Essential Vitamin C Oil Boosts and brightens your skin with this potent antioxidant that neutralises free radicals, brightens skin and helps with natural skin regeneration process. Cleansing Tea Tree Oil Its soothing and anti-inflammatory properties helps in thoroughly cleansing the surface of your skin while treating inflamed parts of skin for a soothing and relaxed sensation. Detoxifying Green Tea Rich in antimicrobial, antioxidant and anti-inflammatory properties effective for treating acne.   Describe your products in three words. 100% natural, Paraben & sulfate free & Ayurvedic How did you come up with the idea for this product? During the 1970s a modern day over the counter products was rarely seen and heard elsewhere. Navnit Mehra draws from the cultural background of a prominent family typically having a rich traditional lineage of \'Hakims\'. She could not pull off her lifelong dream of starting a 100% natural, Ayurveda & Apothecary brand of organic products until in 2016, Arjoon - her son undoubtedly inspired her. Greenberry Organics is a fresh and modern-day apothecary preparation based on the unique experience of a traditional \'Unani, Hakim & Vaid\' family that dates back to almost 7 marked decades. What makes your product special? At Greenberry Organics, our organic products are traditionally made from Ayurveda recipes which have been improved remarkably over the considerable period of time to co-exist with the modern-day demands on increasing skin issues. We use 100% USDA & ECOCERT certified ingredients. Being one of the leading and brightest start-ups we focus on certain fine grade Bio Active ingredients from Brazil, Spain & Germany like - Sun Cat DE, Phyto Defense CLR, MuruMuru Butter, Pracaxi Oil Complex, Pentavitin, Nipa Guard SCE, etc. We are over here to make the potential customers sufficiently realise the distinct advantages of these 100% naturally derived essential ingredients. What has been the best part of your experience? We believe the most tremendous part of our successful venture is being able to work together on something that we have faith in and obviously coming out as one of India\'s few mother-son duos who has aspired to instantly raise the bar in the Natural, Ayurvedic and Organic Skin Care domain. Greenberry Organics consist of a wonderful team of in-house experts from around India who have blessed us with their innovative techniques and traditional secrets.', NULL, 'About Greenberry Organics: Greenberry Organics stands as a brand with a purpose to ensure quality and natural beauty solutions and maintain macro focus on our consumers. We believe in transparency, sm...', 'greenberry-organics-detox-charcoal-face-wash-vitamin-c-green-tea-te-1', 'CHS-23950', 34900, 29900, 20940, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/31BR9DYe5SL._SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:20', '2025-09-22 11:50:20'),
