(397, 1, '760', 614, 'Vaadi Herbals Lemongrass Anti Pigmentation Massage Cream, 50g', 'A super rich mixture of various essential oils, this massage cream leaves your skin feeling super soft, supple and refreshed. Nutrientrich lemongrass and cedarwood penetrate into the deeper layers of the skin granting health to the cells and fading away blemishes and marks. It makes your skin clear and vibrant. In what way are massages beneficial for the skin? Stress toys with all our lives. No exceptions. Our lifestyles are taking a toll on us thanks to all that make-up, heat styling, lack of exercise and a healthy diet and no time for oneself tends to show up on the skin eventually. With no time to relax or let the skin breathe, the beauty and shine that the skin possesses naturally is all lost. Result: Lack-luster skin with blemishes and sun tan. A regular massage with a good cream promises the flawless, impressive skin that appeals to eyes and enhances your personality. Containing the goodness of natural herbs and essential oils, this Massage Cream will gently seep in and replenish the lost nutrients and provide the skin for that dream-like sheen. A healthy pink complexion will be seen with a regular massage thereby making your skin smooth and supple. What is the benefit of Lemongrass Oil to the skin? From Cymbopogon Citratus is taken out this powerful astringent called Lemongrass. Lemongrass oil is a the perfect skin toner that goes deep in the skin\'s layers and regulates the sebum secretion from the sebaceous glands. Also, Lemongrass oil unclogs pores with gentle exfoliation, further cleansing the skin from within. Lemongrass Oil keeps the skin acne-free and other allergies and infections also keep off. Lemongrass oil has great anti-septic properties which make it an excellent healer. Curing scars, pigmentation, blemishes and patches is another huge benefit of having Lemongrass Oil as an active ingredient. Lemongrass oil also fights cellulite. How does Cedar wood Oil prove to be beneficial for the skin? Cedarwood Oil is an essential oil. It is extracted from the Juniperus virginiana. Cedar Wood Oil doubles as an effective acne specialist for the skin. By controlling oil, Cedarwood Oil ensures the cleansing of dirt and impurities off the skin which is attracted by oil. Cedarwood oil prevents and protects the skin from any external damage. Also, its anti-inflammatory property makes it a great shield from the UV rays of the sun. Cedar Wood oil is an excellent astringent and is effective in clearing post-acne scarring and blemishes. By promoting cell-growth and regeneration, Cedar wood Oil facilitates the skin renewal process. What is the role of Manjistha in skin care? Rubia cordifolia or Manjistha is a miracle herb for curing black spots, scars, pigmentation, irregular tanning which might lead to discoloration. Manjistha works effectively on the surface where it accelerates rapid healing and penetrates deep in skin\'s layers to bring back the glow and health that is robbed off due to constant exposure to harmful UVA and UVB rays. Manjistha is a healer as well as care-taker of the skin. Premature aging of the skin is significantly halted, wrinkles fade away and skin looks fresh, supple and flawless with regular use of Manjistha. What is Jojoba Oil and how does it add up as the perfect ingredient for skin care? Simmondsia chinenis or Jojoba tree yields this highly moisturizing Jojoba Oil. It is commonly called as wax ester. Jojoba tree plantations are found in North-west Mexico, South Arizona and South California. Out of all the oils found in nature, Jojoba Oil is most comparable to the oil produced by sebaceous glands of the human skin. Providing skin with high level of nutrients and moisture, Jojoba oil regulates the oil balance, removes flakiness and cures dry patches. Also, the skin feels softer, healthier and has a glow about itself. Jojoba Oil does not evaporate and hence keeps the skin hydrated round the clock. With a high percentage of anti-oxidants, Jojoba Oil envelopes the skin safe from external factors without making it greasy. What is the special moisturizing action of Almond Oil? Almond Oil is known to be the perfect remedy for dry, flaky skin as it quickly gets absorbed in the skin surface. Being a light oil, Almond Oil cures skin irritation, allergies, dry patches and makes the skin soft and supple. A great emollient, Almond Oil serves to be the perfect treatment of the skin for fighting the chill and renewing it for another season cycle. It keeps the skin\'s moisture balance intact. Regular massage regulates the blood circulation which in turn helps in the proper soaking of essential nutrients in the skin. The skin smells sweet and is smooth to touch with Almond Oil.', NULL, 'A super rich mixture of various essential oils, this massage cream leaves your skin feeling super soft, supple and refreshed. Nutrientrich lemongrass and cedarwood penetrate into the deeper layers of...', 'vaadi-herbals-lemongrass-anti-pigmentation-massage-cream-50g-1', 'WHZ-75827', 29000, 18900, 17400, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/41HW2NRnh+L._SX300_SY300_.jpg\"]', '1', '2025-09-22 11:50:20', '2025-09-22 11:50:20'),
