(423, 1, '761', 877, 'Wobble Wag Giggle Ball 2 Pack- Interactive Dog Toy, Fun Giggle Sounds', 'Your dog is going to love the Wobble Wag Giggle Ball! Watch as your pup leaps and bounds when they hear these playful sounds! This is an interactive toy meant to keep your dog entertained and active. The secret is the noisemaker inside that lets out sound as your pup rolls it around. The ball also has 4 clutch pockets that allow it to be picked up with ease by dogs of all sizes. Best of all, this toy does not require batteries. With the Glow in the Dark Ball, dogs can play any time of the day. Whether its dark out or light, this toy is sure to delight. Wobble Wag Giggle is part of the Pets Know Best brand! FURRY FRIEND TESTED, OWNER APPROVED! Charging the Glow in the Dark Material We recommend that before each use you place the ball under a light source. To quickly charge the material, shine a flashlight over the ball for 30 seconds. Cleaning Instructions If the toy becomes dirty, just rinse and clean the surface of the ball with warm water. Make sure not to submerge the ball in water and let it dry completely before you give it back to your pup to play. Safety Information This toy is designed for pets, be sure to keep this toy away from children to avoid injury. Most importantly, this toy has been designed for play and it is NOT a chew toy. If you notice that parts of the toy have become damage, detached, or are showing excessive wear please discard the toy. As always, please make sure to supervise your dog while they play.', NULL, 'Your dog is going to love the Wobble Wag Giggle Ball! Watch as your pup leaps and bounds when they hear these playful sounds! This is an interactive toy meant to keep your dog entertained and active....', 'wobble-wag-giggle-ball-2-pack-interactive-dog-toy-fun-giggle-sounds-1', 'ROS-66264', 2499, NULL, 1499, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/81VC0jfAsiL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-