(424, 1, '761', 888, 'Stand for Steam Deck Console, Adjustable Wall Mounted and Desktop 2-in With Price', 'About this item 2023 New Design- Wall-mounted and desktop 2-in-1 bracket steam holder with micro SD slots for Steam Deck Console. This is a well-made stand for the Steam Deck. 5 Angles of View- The Steam Deck base offers 5 different viewing angles depending on your needs. Fully adjustable so you can pick your angle of tilt.Provide excellent viewing angles for playing game and watching video. Solid Build Steam Stand- Made from high quality aluminium alloy, it holds your Steam stable and without any wobble. it is able to hold Steam Deck up without dropping from the weight. Perfect Fit- A perfect fit for the Steam Deck. The grip is in the right places,and the width was perfect your deck with no obtrusive blocking of the rear air vent. Specially Designed For Steam Deck - The Dock is only for Steam Deck. They are packed with nice box, is a perfect gift for your friends who has a Steam console.', NULL, 'About this item 2023 New Design- Wall-mounted and desktop 2-in-1 bracket steam holder with micro SD slots for Steam Deck Console. This is a well-made stand for the Steam Deck. 5 Angles of View...', 'stand-for-steam-deck-console-adjustable-wall-mounted-and-desktop-2-in-1', 'WT4-86475', 699, 499, 419, NULL, 0, '0', NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/61PKlH5qDIL.__AC_SX300_SY300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:21', '2025-09-23 15:30:50'),
(425, 1, '762', 73, 'In The Swim Chlorine Neutralizer for Swimming Pools - Quickly Reduces', 'In The Swim Chlorine Neutralizer In the Swim Chlorine Neutralizer reduces excess chlorine levels in pools, ensuring safe swimming conditions. Ideal chlorine levels range from 3 - 4 ppm. High chlorine levels can harm hair and skin. Product contains 90% Granular Sodium Thiosulfate. Add 5 oz per 10,000 gallons to lower chlorine. Turn off chemical feeds and systems, test water, measure the needed dose, and add it while the circulation system is running. Let it circulate for 30 minutes, then retest before swimming. Repeat if needed.         In The Swim\'s Proper Pool Care Recommendations Previous page Adjusting and Balancing Regularly test pool/spa water to maintain optimal chemistry, promoting a healthy environment, saving cost, and reduce pool maintenance. Sanitizing Keep water clean using trichlor tablets, along with shock and granular chlorine for maintenance, for a sparkling clean pool. Treatment Pool not looking perfect, begin by testing the water. Address specific issues such as algae, cloudiness, debris, or other conditions with needed chemcials. Pool Safety Ensure a safe aquatic environment with essential safety equipment, knowledge of local regulations and pool supervision Next page Keep Your Pool Sparkling Clear All Season Long 3 Inch Chlorine Tablets See Details Cal-Hypo Pool Shock See Details Bromine Tablets See Details 5-in-1 Super Multi-Tabs See Details Di-Zap 3-in-1 Shock See Details Customer Reviews 4.6 out of 5 stars 19,422 4.6 out of 5 stars 13,938 4.7 out of 5 stars 1,506 4.7 out of 5 stars 675 4.6 out of 5 stars 112 Purpose Sanitizing Chlorinating Water Sanitizing Sanitizing Sanitizing Main Ingredient Trichloro Calcium Hypochlorite Bromine Trichlor Dichlor Ingredient % 99% 68% 61% 84% 99% Application Floating dispenser Pre-dissolve Floating dispenser Floating dispenser Floating dispenser Features Long lasting defense Versatile, fact-acting shock Odorless Multi-Functional Incl. Algaecide & Stabilizer', NULL, 'In The Swim Chlorine Neutralizer In the Swim Chlorine Neutralizer reduces excess chlorine levels in pools, ensuring safe swimming conditions. Ideal chlorine levels range from 3 - 4 ppm. High chlorine...', 'in-the-swim-chlorine-neutralizer-for-swimming-pools-quickly-reduces-1', 'OW5-47032', 226, 196, 136, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/416GD0OOCdL._AC_.jpg\", \"https://m.media-amazon.com/images/I/613DvPHI5oL._AC_SL1000_.jpg\", \"https://m.media-amazon.com/images/I/61oQ+zbKUVL._AC_SL1000_.jpg\", \"https://m.media-amazon.com/images/I/61hpOalJljL._AC_SL1000_.jpg\", \"https://m.media-amazon.com/images/I/71gq2H4HtVL._AC_SL1500_.jpg\", \"https://m.media-amazon.com/images/I/61b5uu6PF3L._AC_SL1000_.jpg\"]', '1', '2025-09-22 11:50:21', '2025-09-22 11:50:21'),
(426, 1, '762', 98, '2-2440-02 Flocculant for Pool, 1-Quart, 2-Pack', 'This product will effectively flocculate organic and inorganic particles in swimming pool water. For Cartridge Filter Pools: You must have the capability to vacuum to waste (by-pass filtration). Test pool water pH with a reliable test kit, adjust pH to 7.2 or greater. For highly turbid pool water, turn off pump and dispense approximately 4 oz. of this product per 5,000 gallons of water evenly over the water surface and then immediately brush pool walls and steps. Wait 24-72 hours to allow organic and inorganic particles to settle to pool floor. Cartridge Filter Pools: With the pool pump off, remove filter element and then reassemble filter canister. Prepare to manually vacuum pool to waste. Turn pool pump on and slowly vacuum pool until heavy sediment is removed. Turn pump off, reinstall filter element, and resume normal filter operation for at least 24 hours. Monitor pressure on pool filter and if pressure exceeds your normal operating pressure: turn system off, clean filter element and then resume filtering until pool is clear and free of sediment. Sand and D.E. Filter Pools: With the pool pump off, prepare to manually vacuum pool to waste. Turn pool pump on and slowly vacuum pool until heavy sediment is removed then resume normal filter operation for at least 24 hours. Monitor pressure on pool filter and if pressure exceeds your normal operating pressure, backwash filter and then resume filtering until pool is clear and free of sediment. This product may be used as a part of weekly pool maintenance to prevent the pool water from becoming cloudy or turbid. Apply 1 oz. of this product per 5,000 gallons of pool water directly into the skimmer or around the pool perimeter while the circulation system is in operation.', NULL, 'This product will effectively flocculate organic and inorganic particles in swimming pool water. For Cartridge Filter Pools: You must have the capability to vacuum to waste (by-pass filtration). Test...', '2-2440-02-flocculant-for-pool-1-quart-2-pack-1', 'LWD-26580', 380, NULL, 228, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/81KuoamNkgL._AC_SL1500_.jpg\", \"https://m.media-amazon.com/images/I/71U9YGj+M7L._AC_SL1500_.jpg\", \"https://m.media-amazon.com/images/I/71lLlKD0zoL._AC_SL1500_.jpg\"]', '1', '2025-09-22 11:50:21', '2025-09-22 11:50:21'),
