(432, 1, '763', 568, 'Blue Buffalo Freedom Grain Free Natural Adult Wet Dog Food, Chicken 12', 'Product Description If your dog doesnt do well with grains, switch to BLUE Freedom grain free wet dog food. Made from the finest natural ingredients enhanced with vitamins and minerals, this mouthwatering recipe starts with high-quality chicken and is packed with healthy fruits and vegetables. Plus, unlike many other wet dog foods, its made without wheat as a thickener. Formulated with complex carbohydrates, this wholesome recipe will help your best pal stay active and healthy. From the Manufacturer BLUE Freedom canned food is made with the finest natural ingredientsingredients chosen with great care by our animal nutritionists, providing your dog with hiqh-quality protein and complex carbohydrates that he needs to stay active and healthy. Starts with delicious, protein-rich Chicken, Whole carrots, sweet potatoes, peas, blueberries and cranberries. NO chicken or poultry by-product meals, corn, wheat, soy and nothing artificial.', NULL, 'Product Description If your dog doesnt do well with grains, switch to BLUE Freedom grain free wet dog food. Made from the finest natural ingredients enhanced with vitamins and minerals, this mouthwat...', 'blue-buffalo-freedom-grain-free-natural-adult-wet-dog-food-chicken-12-1', 'LOQ-52920', 479, NULL, 287, NULL, 0, NULL, NULL, NULL, NULL, '[\"https://m.media-amazon.com/images/I/815QCjWPf4L.__AC_SY300_SX300_QL70_FMwebp_.jpg\"]', '1', '2025-09-22 11:50:21', '2025-09-22 11:50:21'),
